import React from "react";
import {
    withScriptjs,
    withGoogleMap,
    GoogleMap,
    Marker
} from "react-google-maps";
import {useDispatch, useSelector} from "react-redux";
import {getRouteProps} from "../redux/apiMobileV2/ApiMobileV2Action";


function RouteProps() {

    const dispatch = useDispatch();
    const data = useSelector(state => state.apiMobileV2Reducer.routePropsData);
    const status = useSelector(state => state.apiMobileV2Reducer.routePropsStatus);
    React.useEffect(() => {
        dispatch(getRouteProps())
    }, []);
    console.log(data)
}



const MapWithAMarker = withGoogleMap(() =>
    <GoogleMap
        defaultZoom={8}
        defaultCenter={{ lat: -34.397, lng: 150.644 }}
    >
        <Marker
            position={{ lat: -34.397, lng: 150.644 }}
        />
    </GoogleMap>
);


export default function Maps() {
    return (
        <MapWithAMarker
            containerElement={<div style={{ height: `400px` }} />}
            mapElement/>
    );
}
